import React from "react";
import NavBar from "./NavBar";
import Header from "./Header";
import City from "./City";
import { DUMMY_CITY, DUMMY_TYPE, DUMMY_HOTEL, NAVBAR } from "./shared/homapage";

const Home = () => {
  return (
    <div>
      <NavBar />
      <Header />
      <City city={DUMMY_CITY} />
    </div>
  );
};

export default Home;
